const CvContactLink = () => {
  return (
    <ul className="grid grid-cols-4">
      <li>LinkedIn</li>
      <li>GitHub</li>
      <li>Telegram</li>
      <li>Discord</li>
    </ul>
  );
};

export default CvContactLink;
